import React from "react";
import {Container, Form, Col} from "react-bootstrap";
import NavigationPriceCalculator from "./NavigationPriceCalculator";

function Final() {
  return (
    <>
    <NavigationPriceCalculator />
    <Container fluid style={{
          borderTop: "4px solid black",
          borderBottom: "4px solid black",
          textAlign: "center",
          marginTop: "3rem",
          padding: "2rem",
        }}>
<h3>Your estimated price is...</h3>
<h1 className="price">780 DKK/month</h1>
<p className="paragraph_1">Would you like to have a discussion with us about your project?
</p>
<p className="paragraph_2">Then enter your details down below, and one bonus, you will get the estimated price, together with the additional details in your email inbox.
</p>
<Col>
<Form>
<Form.Group
                style={{
                  marginBottom: "2rem",
                }}
              >
                <Form.Label>Your full name</Form.Label>
                <Form.Control
                  type="text"
                  value={full_name}
                  name="full_name"
                //   onChange={(event) => setFullName(event.target.value)}
                  style={{
                    borderBottom: "3px solid black",
                    height: "3rem",
                  }}
                ></Form.Control>
              </Form.Group>

              <Form.Group
                style={{
                  marginBottom: "2rem",
                }}
              >
                <Form.Label>Your email address</Form.Label>
                <Form.Control
                  name="email"
                  value={email}
                  type="email"
                //   onChange={(event) => setEmail(event.target.value)}
                  style={{
                    borderBottom: "3px solid black",
                    height: "3rem",
                  }}
                ></Form.Control>

                <Form.Label>Your phone number</Form.Label>
                <Form.Control
                  name="email"
                  value={email}
                  type="email"
                //   onChange={(event) => setEmail(event.target.value)}
                  style={{
                    borderBottom: "3px solid black",
                    height: "3rem",
                  }}
                ></Form.Control>
                </Form.Group>
                <Button
                type="submit"
                value="Submit Form"
                style={{
                  fontSize: 30,
                  fontWeight: "bold",
                  backgroundColor: "#7F7EC7",
                  color: "whitesmoke",
                  borderBottom: "4px solid black",
                  marginTop: "3rem",
                }}
              >
                Submit
              </Button>{" "}
    </Form>
</Col>
        </Container>
        </>
  )
}

export default Final
